import React from "react";
import "./App.css";
import "./MovieCard.css";


function MovieCard({props}) {
    const { title, year, duration, genre, score } = {props};
    if (!title) return <div />;
    return (
      <table>
        <tbody>
          <tr>
            <td>
              <h5>{props.title}</h5>
            </td>
            <td>
              <h5>{props.year}</h5>
            </td>
            <td>
              <h4>{props.duration}</h4>
            </td>
            <td>
              <h4>{props.score}</h4>
            </td>
            <td>
              <p>{props.genre}</p>
            </td>
            <td>
              <p>{props.score}</p>
            </td>
          </tr>
        </tbody>
      </table>
    );
  }

export default MovieCard;
